add: AConfig.Core.Server.Exchange-Specific.[ExchIds].GAL.Work-Up-Market | Setting indicating that the gateway supports workup market.  A setting of 0 (or unspecified) indicates that workup market is not supported.  A setting of 1 indicates that workup market is supported.| 0 | <!--empty--> | string
