add: AConfig.Core.Crypto.CipherName | OpenSSL symmetric cipher in use throughout the TT system.| 0 | rc4 | string
add: AConfig.Core.Crypto.Install | Install encryption hook functions and engage in crypto.| 0 | false | bool
