add: AConfig.Core.Guardian.DisableAConfigSend | Prevent Guardian and guardserv from being a source for other hosts to receive an AConfig | 0 | false | bool
add: AConfig.Core.Server.Exchange-Specific.[ExchIds].GAL.Support-LOO | Setting indicates support for Limit On Open order type.  This is a Limit Order that applies only to the Open. If not filled at the Open, then it is canceled. This order type is only supported natively in the exchanges that support it.  A setting of 0 (or unspecified) indicates no support.  A setting of 1 indicates support. | 0 | <!--empty--> | string
add: AConfig.Core.Server.Exchange-Specific.[ExchIds].GAL.Support-LOC | Setting indicates support for Limit On Close order type.  This is a Limit Order that applies only to the Close. If not filled at the Close, then it is canceled. This order type is only supported natively in the exchanges that support it.  A setting of 0 (or unspecified) indicates no support.  A setting of 1 indicates support.| 0 | <!--empty--> | string
add: AConfig.Core.Client.API-Specific.Price.AckTimer | Sets the time delay (in milliseconds) before the price api requests the next packet. | 0 | 5 | int
add: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.Contracts-Per-Message | Number of contracts sent in response to a pricetable or contract download request. Valid values are positive. Values less than 1 use default. | 0 | 4 | int
add: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.ProductHandling | Set to 0 (default) to have the currently active price server handle the requests. Set to 1 to have the standby price server handle the requests (if standby server goes down requests aren't handled until it comes back up). Set to 2 to have standby handle product requests unless none is running then active handles requests. | 0 | 0 | int
add: AConfig.Core.Server.Exchange-Specific.[ExchIds].Market-Depth.DetailDepth | The flag used to turn on/off detail depth support. 0 means turn off detail depth support, 1 means turn on detail depth support. 0 is used as default. If this value is missing, it will treated as 0 inside gateway. | 0 | 0 | int
add: AConfig.Core.Server.Exchange-Specific.[ExchIds].Market-Depth.NumDepthLevels | The flag used to turn on/off limiting the levels of depth sent to clients. The full depth is still maintained on the server. Set to -1 (default) to send all available levels of depth. Depth levels start at 1 (inside market). | 0 | -1 | int
add: AConfig.Core.Server.Exchange-Specific.[ExchIds].GAL.Limit-Market-To-Limit | Setting indicating that the gateway supports limit market to limit orders.  A setting of 0 (or unspecified) indicates that limit market to limit orders are not supported.  A setting of 1 indicates that limit market to limit orders are supported.| 0 | <!--empty--> | string
add: AConfig.Core.Client.API-Specific.Price.Servers-Use-MPF | Obsolete - No longer used. | 0 | false | bool
add: AConfig.Core.Server.Exchange-Specific.[ExchIds].TTQAP.Rollover | When set to "true", TTQAP values are reset daily at the time specified in the server specific Time.Zone section of AConfig.  When set to "false", TTQAP reset is triggered by an exchange event.  NOT ALL GATEWAYS FUNCTION CORRECTLY WITH A VALUE OF FALSE.  If this value is set to false for a Gateway that is not equipped to handle a setting of false, TTQAP values for that Gateway will never be reset. | 0 | true | bool
add: AConfig.Core.LoggingSeverityLevel.TTLogFile | Used to adjust the amount of data sent to the log files 2 is the default value. Lower Numbers mean less data. | 0 | 2 | int
add: AConfig.Core.LoggingSeverityLevel.AppSpecificLogFile | Used to adjust the amount of data sent to the log files 2 is the default value. Lower Numbers mean less data. | 0 | 2 | int
addonly: AConfig.Core.SimLocal | Used to indicate if TTSIM Local mode is on. | 0 | false | bool
add: AConfig.Core.Guard.Guardian.EnableDaemonSetupGUI | Determines whether the 'Daemon Setup' option under the Config menu item of Guardian is enabled or grayed out. Some applications e.g. TTRelay want to configure Daemon setup manually as opposed to through the Guardian GUI. | 0 | true | bool
add: AConfig.Core.Server.Exchange-Specific.[ExchIds].Time.Zone.Standard.Exchange-Day-Start | Exchange-Day-Start is the hour:minute:second of the start of the trading day, in local exchange time. It is ok to omit minute and second, they default to zero. If data is missing or invalid Exchange-Day-Start defaults to midnight. Note: If this value is changed, the Price, Order, Order Routers, and Fill Servers must ALL be restarted so they will remain in synch with each other as to rollover time. | 0 | <!--empty--> | string
add: AConfig.Core.Server.Exchange-Specific.[ExchIds].Time.Zone.Daylight.Exchange-Day-Start | Exchange-Day-Start is the hour:minute:second of the start of the trading day, in local exchange time. It is ok to omit minute and second, they default to zero. If data is missing or invalid Exchange-Day-Start defaults to midnight. Note: If this value is changed, the Price, Order, Order Routers, and Fill Servers must ALL be restarted so they will remain in synch with each other as to rollover time. | 0 | <!--empty--> | string
