addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.PFXEnabled|A value of true instructs the server to generate price updates in the PFX mode.  A value of false indicates TTAPI formatted price updates. Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | false | bool
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.NTDUpdateInterval|Milliseconds. Controls the interval at which Non-TradeData updates are being naggled and broadcast onto the wire.  A value of 0 disables Non-TradeData nagling so that all updates are broadcast immediately.  This setting is used only when PFXEnabled is set to true.  In the PFXConverted GW that outputs TTAPI price updates NTD coalescing follows the same model as the selected PDD type. Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | 50 | int
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.LogNonPFXClients|Set to true to log in price server log file price request/subscription and VAP requests/subscriptions from non-PFX clients when the server is converted to PFX.  The requests will be rejected if the server is operating in the PFX mode as well.| 0 | false | bool
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.TruncateSubjectNames|A value of true will truncate long price subjects.  A value of false will not truncate price subjects. Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | true | bool
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.PDD.Type|Selects a mode of Prioritized Data Delivery (PDD).  A value of -1 indicates that the setting of Market-Depth.Interval-mSecs should be queried and used if set.  A value of 0 means no PDD at all.  1 indicates IO Decoupling PDD.  Further settings for this type are collected in the PDD.IODecoupler block.  A value of 2 indicates Time Based Decoupling PDD.  A value of 3 indicates Strict Timer Coalescing PDD.  Further settings for types 2 and 3 may be specified in the PDD.Coalescing block.  Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | -1 | int
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.PDD.QueueCount|A number of distinct queues (threads) used when a specific PDD mode is selected.  Not used when PDD is set to 0 (off). Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | 1 | int
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.PDD.EchoCount|Count. The maximum number of EchoTimeout periods. Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | <!--empty--> | int
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.PDD.EchoTimeout|Seconds. The minimum period of time passed prior to resending a TradeData update when no market updates are received from the exchange for a product. Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | <!--empty--> | int
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.PDD.IODecoupler.SnapshotInterval|Count. A maximum number of Exchange price updates that will be processed before a TradeData message in response to a contract snapshot request will have been broadcast.  Any price data modifications applied during this interval will be reflected (coalesced) in the broadcast update message as well. Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | 5000 | int
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.PDD.IODecoupler.DepthInterval|Count. A maximum number of Exchange price updates that will be processed before a TradeData message in response to a market depth modification will have been broadcast.  Any price data modifications applied during this interval will be reflected (coalesced) in the broadcast update message as well. Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | 1000 | int
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.PDD.IODecoupler.IMInterval|Count. A maximum number of Exchange price updates that will be processed before a TradeData message in response to an inside market modification will have been broadcast.  Any price data modifications applied during this interval will be reflected (coalesced) in the broadcast update message as well. Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | 50 | int
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.PDD.IODecoupler.TradeInterval|Count. A maximum number of Exchange price updates that will be processed before a TradeData message in response to a price modification resulting from a completed trade will have been broadcast.  Any price data modifications applied during this interval will be reflected (coalesced) in the broadcast update message as well. Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | 50 | int
add: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.PDD.IODecoupler.IdleDetectCount|Count. Indicates how many times the output thread should give up the CPU before deciding that a GW is not processing any new inputs.  When idle GW is detected pending TradeData updates will be broadcast onto the network immediately. Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | 100 | int
add: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.PDD.Coalescing.SnapshotInterval|Milliseconds.  The minimum period of time between broadcasts of consecutive TradeData updates resulting from snapshot requests.  Any price data modifications applied during this interval will be reflected (coalesced) in the broadcast update message as well. Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | 25 | int
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.PDD.Coalescing.DepthInterval|Milliseconds.  The minimum period of time between broadcasts of consecutive TradeData updates resulting from market depth updates.  Any price data modifications applied during this interval will be reflected (coalesced) in the broadcast update message as well. Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | 50 | int
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.PDD.Coalescing.IMInterval|Milliseconds.  The minimum period of time between broadcasts of consecutive TradeData updates resulting from inside market updates.  Any price data modifications applied during this interval will be reflected (coalesced) in the broadcast update message as well. Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | 25 | int
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.PDD.Coalescing.TradeInterval|Milliseconds.  The minimum period of time between broadcasts of consecutive TradeData updates resulting from completed trades.  Any price data modifications applied during this interval will be reflected (coalesced) in the broadcast update message as well. Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | 25 | int
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.PDD.Coalescing.ImmediateInterval|Count. Indicates how many additional Exchange price updates a TradeData update that has reached its update rate interval will attempt to collect before broadcasting a TradeData message onto the network. Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | 100 | int
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.PDD.Coalescing.IdleDetectCount|Count. Indicates how many times the output thread should give up the CPU before deciding that a GW is not processing any new inputs.  Pending TradeData updates that have reached the update rate they were scheduled for will be broadcast onto the network immediately when idle GW is detected.  This setting is similar in use to PDD.IODecoupler.IdleDetectCount. Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | 100 | int
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.PDD.Coalescing.EarlySendEnabled|Set to true to allow pending contracts from a given product to be sent in the same message at the time any single contract from that product is sent out (either as a result of an immediate send or when the priority interval has expired). Do not modify this setting unless specifically instructed to do so by TT Support.| 0 | false | bool

