addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].GAL.Support-Estimated-Place-In-Queue | Setting that tells client applications that the gateway supports estimated place in queue. A setting of 0 indicates that the gateway does NOT support Estimated Place In Queue. A setting of 1 (or unspecified) indicates that the gateway DOES support Estimated Place In Queue. | 0 | 1 | string
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].GAL.Price-Server-Accepts-Series-Create | Setting that tells client applications that the price server on the gateway accepts series creation requests. A setting of 0 (or unspecified) indicates that the price server on this gateway does NOT accept series creation requests and in this case series creation requests should be sent to the order server. A setting of 1 indicates that the price server on this gateway DOES accept series creation requests. | 0 | 0 | string
