addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.TokenEnabled | A value of true instructs the server to look for tokens in the contract download request and short circuit the download if a matching token is found in its product/price tables. Do not modify this setting unless instructed to do so by TT Support. | 0 | true | bool
addonly: AConfig.Core.Client.API-Specific.Price.TokenEnabled | A value of true instructs the client to attach a product/price token in its contract download request to the price server or price proxy server. Do not modify this setting unless instructed to do so by TT Support. | 0 | true | bool
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.PriorityID | In a failover situation the price server with the highest PriorityID will go active. The default value of 0 will set the PriorityID to the IP address. | 0 | 0 | int
