addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Snapshot-Message-Pacing-Interval|Indicates the global pacing interval, in milliseconds, for multicasted price downloads| 0 | 0 | int
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].GAL.Fill-Feed-Has-Clearing-Data | Setting that tells client applications that fills sent on the fill feed from this gateway will contain newer clearing data than the fill sent on the order feed. A setting of 0 (or unspecified) indicates that the gateway will send the same data down the order AND fill feed. A setting of 1 indicates that the gateway will have additional clearing information on the fill feed. | 0 | 0 | string
addonly: AConfig.Core.Server.Exchange-Specific.[ExchIds].Price-Server.Abbreviated-SeriesID-Snapshots | Indicates if the price server should send abbreviated series IDs on price refreshes (PFX mode only). Do not modify this setting unless instructed to do so by TT Support.  | 0 | false | bool
addonly: AConfig.Core.Client.API-Specific.Price.Synchronized-Snapshot-Timeout | Amount of time, expressed in milliseconds, the client will wait for TradeData packets before timing out when doing sychronized price subscription. Applies only to subscription requests on PFX servers. Do not modify this setting unless instructed to do so by TT Support. | 0 | 2000 | int
